import React, { Component } from 'react'

export default class About extends Component {
  render() {
    return (
      <div>
        <section class="bg-title-page p-t-40 p-b-50 flex-col-c-m" style={{backgroundImage: 'images/heading-pages-06.jpg'}}>
          <h2 class="l-text2 t-center">
            About
		</h2>
        </section>
      </div>
    )
  }
}
